          </div>
          <p className="text-sm font-medium text-ink-800">{dim.value}</p>
          {dim.extra && (
            <p className="text-xs text-ink-500 mt-1">æ ¸å¿ƒå¼ åŠ›ï¼š{dim.extra}</p>
